import React from "react";
import { Link } from "react-router-dom";

function Header() {
  return (
    <div className="main-header">
      <ul>
        <li>
          <Link to="/" className="headerlink-title">
            Urheilijat
          </Link>
        </li>
        <li>
          <Link to="add" className="headerlink-title">
            Add
          </Link>
        </li>
      </ul>
    </div>
  );
}

export default Header;
